#include "libft_test.h"

static void test_ft_memmove_one(void *src0, size_t len, ssize_t offset0, int *current, int total) {
	
	*current += 1;
	unsigned char *dst;
	unsigned char *src;

	ssize_t offset_abs = offset0 < 0 ? offset0 * -1 : offset0;

	/// malloc and adjust src & dst positions
	unsigned char *mem_block = (unsigned char *)malloc(len + offset_abs + 1);
	bzero(mem_block, len + offset_abs + 1);
	if (offset0 < 0) {
		dst = mem_block;
		src = mem_block + offset_abs;
	} else {
		src = mem_block;
		dst = mem_block + offset_abs;
	}
	/// copy source content to the correct memory position
	memcpy(src, src0, len);
	/// do the action
	ft_memmove(dst, src, len);

	/// compare to the original souce (the actual one, could be augmented at this stage)
	src = (unsigned char *)src0;
	for (size_t i = 0; i<len; i++) {
		if (src[i] != dst[i]) {
			printf("FT_MEMMOVE failed at [%d][%zu]: %u != %u\n", *current, i, dst[i], src[i]);
			fflush(stdout);
		}
		assert(src[i] == dst[i]);
	}
	free(mem_block);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_memmove_speed()
{
	char	*src;
	char	*dst;

	CATEGORY("ft_memmove forward performance");

	size_t len = 1048576;
	size_t iter = 1000;

	clock_t start = 0;
	src = (char *)malloc(sizeof(char) * len);
	memset(src, '4', len);
	dst = (char *)malloc(sizeof(char) * len);
	/// normal
	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memmove(dst, src, len);
	}
	clock_t end = clock();
	double time_fwd = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / time_fwd, "memmove");

	ft_bzero(dst, len);
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		ft_memmove(dst, src, len);
	}
	end = clock();
	double time_ft_fwd = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / time_ft_fwd, "ft_memmove");
	SPEEDCMP((time_fwd / time_ft_fwd) * 100, "memmove");
	free(src);
	free(dst);

	CATEGORY("ft_memmove backward performance");
	size_t offset = len / 4;
	src = (char *)malloc(sizeof(char) * (len + offset));
	memset(src, '4', len);
	dst = src + offset;

	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memmove(dst, src, len);
	}
	end = clock();
	double time_bkw = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / time_bkw, "memmove");

	ft_bzero(dst, len);
	memset(src, '4', len);
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		ft_memmove(dst, src, len);
	}
	end = clock();
	double time_ft_bkw = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / time_ft_bkw, "ft_memmove");
	SPEEDCMP((time_bkw / time_ft_bkw) * 100, "memmove");
	free(src);
}
#endif // SPEEDTEST

